Product.create!([
  {name: "Sweet Mountain Honey Aaaa", description: "Sweet Mountain Honey aka Honey Kush can found in the California collective scene. It is a cross of Nebula, which may earn the nickname \"Honey Pot\" for it's sweet smell and distinctively honey fruit flavor, and a traditional OG Kush pheno-type. The Nebula side is mostly made of White Widow. This variety is a top tasty smoke, even for the veteran stoner. \r\n", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121856_SMH.jpg"], prices: [12.0, 24.0, 40.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Superior Kush Aaaa", description: "Superior kush indica dominant kush with a heavy indica effect accompanied with couch lock. Superior for a reason packs a punch. ", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121815_Superior_Kush.jpg"], prices: [12.0, 24.0, 40.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Diamond Og Aaaa", description: "\r\n\r\n\r\nDiamond OG is a precious gem of a strain that patients love for its potent and long-lasting effects. A true indica, this strain induces full-body relaxation that nixes pain and muscle spasms before settling into an overall laziness\r\n", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121775_diamond_og.jpg"], prices: [13.0, 26.0, 45.0, 85.0, 150.0, 290.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Purple Kush", description: "It has the looks, the flavours, and the effects that make it a well-rounder bud. The flowers violet colouring is wildly saturated and distinct. The aromas bring out a nose-tingling grape fuel that tastes exactly as it smells. The euphoric sedation reaches every body part and intensifies with no end, so its best to enjoy Purple Kush before bedtime.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Purple+Kush_DSC_1623.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "14.0", cbd: "0.22", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "Mk Ultra Aaaa", description: "Named after the methods of mental manipulation employed by the CIAs Project MKUltra, this indica-dominant strain stands apart due to its powerful cerebral effects. A cross between mostly-sativa hybrid OG Kush and indica G-13. MK Ultra is renowned for its hypnotic effects that are fast-acting and best used when strong medication is desired. As evidenced by its collection of awards, this indica is one of the strongest in the world.", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121804_Mk_Ultra_AAAA.jpg"], prices: [11.0, 22.0, 35.0, 70.0, 135.0, 270.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Thompson Caribou Grape Syrup", description: "1 Gram of Premium Concentrates in every 50ml 1000mg of THC infused into an all Natural Grape Syrup Drink Your Dabs, Mix it with your favorite Soda/Pop !\r\n", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121982_lean.jpg"], prices: [55.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Kronvict Baked Goods Wonder Brownie", description: "Kronvict Baked Goods brownie with a wonder bar topping net weight of 40 grams infused with phyto extractions shatter or the clear thc content 200mg. Kronvict baked goods only use quality ingredients such as sugar, flower, corn syrup, cocoa, corn starch, coconut oil, peanut butter and chocolate. ", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3121904_kronvictbrownie.png"], prices: [15.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Phyto Extractions Sour Diesel", description: "Phyto Extractions Sour Diesel", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3668635_Sourdiesel.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "DiabloXNemesisXPinkKush", description: "The superdense buds of this un-familiar lineage have avery unique colour palette that shimmer in a heroic silver tinge. The flavours are very characteristic of Kush with an indica high that is exceptionally strong. This fortified strain is definitely a nighttime toke that shouldnt be taken for granted. The high is a serious creeper that will continue to slowly build and intensify long after the last hit- So puff cautiously.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Diablo_Nemesis_PinkKush_DSC_5632.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "25.0", cbd: "0.41", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
