  {name: "Bubba Kush", description: "The strain has been deemed one of the most potent available producing small, dense nuggets that are hard-caked with resin. Expect notes of pungent skunk, fuel, and a delicate sweetness intermixed. Common effects of relaxed, cheerful mind, with top medicinal uses for appetite loss and stress. This thick, sharp smoke provides an instant and fast0acting body stone that is extremely long lasting and powerful.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Tuna_DSC_1635.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "Girl Scout Cookies", description: "Girl Scout Cookies, or GSC, is an OG Kush and Durban Poison hybrid cross whose reputation grew too large to stay within the borders of its California homeland. With a sweet and earthy aroma, Girl Scout Cookies launches you to euphorias top floor where full-body relaxation meets a time-bending cerebral space. A little goes a long way with this hybrid, whose THC heights have won Girl Scout Cookies numerous Cannabis Cup awards. Patients needing a strong dose of relief, however, may look to GSC for severe pain, nausea, and appetite loss.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Harlequin_DSC_4006.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "16.5", cbd: "0.2", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
