  {name: "Sour Diesel", description: "Sometimes called Sour D, is an invigorating sativa named after its pungent, diesel-like aroma. This fast-acting delivers energizing, dreamy cerebral effects that have pushed Sour Diesel to its legendary status. Stress, pain, and depression fade away in long-lasting relief that makes it a top choice for medical patients. Believed to have descended from Chemdawg, Northern Lights, and a Skunk phenotype.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Sour_Diesel_DSC_3945.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "19.5", cbd: "5.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Sour Tangie", description: "Bringing together the classic Sour Diesel aroma with Tangies creative, elevating buzz and strong citrus overtones. This 80% Sativa has a quick mood boost, feeling energetic and uplifted. Patients with lack of appetite, stress or depression find relief in mood altering Sativa.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Sour_Tangie_DSC_5650.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
