  {name: "Cannabis Pop", description: "A mix of small buds and shake from our various strains. Exceptional quality at an exceptional price!", retailer_id: 6, images: ["./assets/img/sprig.jpg"], prices: [18], price_labels: ["each"], thc: "15.0", cbd: "5.0", subspecies: "Hybrid", category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Okanagan Valley Harvest Mango(70mg THC)", description: "Okanagan Valley Harvest edibles are delicious and healthy options for consuming cannabis, without sulphites, allergens and gluten free. We recommend medicating with edibles for a long lasting and therapeutic full-body effect. Edibles represent a great alternative to capsules and increase bioavailability of cannabinoids by introducing healthy fats and oils that help facilitate absorption of cannabinoids. Conveniently packaged, easy to titrate with and store/freeze for later use. Each bag contains several discrete servings so that measuring and weighting is unnecessary. Mango slices give a healthy option for people who are trying to avoid the sugars and carbohydrates contained in traditional cannabis baking. Medicated with premium cannabis oils using our proprietary process insure even distribution of active compounds.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Okanaga_Valley_Harvest_Mango_DSC_3900.jpg"], prices: [20], price_labels: ["each"], thc: "70.0", cbd: "0.0", subspecies: "", category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Moby Dick", description: "Originating as one of the strongest sativa with a very high THC content, this strain is a cross between indica-dominant hybrid White Widow and sativa Haze; the former is know for its power while the latter for its cerebral stimulation. This strain is a mostly sativa plant that delivers a charged buzz, with a sweet citrus from the Haze, which dominates the palate with vanilla and eucalyptus tones.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Moby_DSC_3759.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "25.0", cbd: "0.41", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
