  {name: "Nuken", description: "The mostly indica Nuken is a Canadian strain bred by combining genetics from Kish( a cross of two Shiskaberry parents) and God Bud. Typically leaves you functional enough to still enjoy hobbies and the social company of others, while undeniably strong with sweet, earthy aromas such as fresh herbs and grass. Many patients with muscle spasm in particular with stress and pain for relief.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Nuken_DSC_1608.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "18.5", cbd: "0.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
