  {name: "Exclusive Extracts Taxeda Timewarp", description: "Exclusive Extracts Taxeda Timewarp", retailer_id: 8, images: ["https://images.weedmaps.com/pictures/listings/791/189/604/large/3576816_texadainsta.png"], prices: [25.0, 50.0], price_labels: ["Half Gram", "Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Pink Bubba", description: "Pink Bubba is a mostly indica strain that is said to combine genetics from Bubba Kush and Pink Kush. Earthy pine flavors lead the way with slight floral highlights that bring out this strains sweet notes. Perhaps best saved for evening use, Pink Bubba delivers a body-melting blast of physical relaxation alongside dreamy euphoria. ", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3807083_Pink_Bubba.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Master Kush", description: "Master Kush is a popular indica cross created out of two landrace strains from different parts of the Hindu Kush region. Master Kush is bred by the Dutch White Label Seed Company, located in Amsterdam. During maturation the plant produces a subtle earthy, citrus smell with a hint of incense, which is often described as a vintage flavor. The taste of Master Kush is reminiscent of the famous hard-rubbed charas hash. This strain holds a superb balance of full-body relaxation without the mind-numbing effect that many indica strains produce. Instead, Master Kush offers a sharpened sensory awareness that can bring out the best of any activity.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3727610_master-kush.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
