  {name: "Hexane CBD 10mg", description: "Capsules produced with cannabis concentrates formulated with coconut oil. These capsules deliver a metered dose of THC/CBD available in varying dosages and content formulations. The cannabis concentrate is mixed with MCT oil to help the body to more fully absorb the beneficial compounds.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Hexane_CBD_10mg_Caps_CloseUp_DSC_3867.jpg"], prices: [3.0], price_labels: ["each"], thc: "0.0", cbd: "10.0", subspecies: "Indica", category: "Capsules", thumbnail: nil, stock: nil},
  {name: "Indica  Co2 Kush Oil Vape Refill", description: "This is pure CO2 THC Oil, it has 91% THC.\r\n\r\nThis vile is to be used with Kush Oil Battery &amp; Charger Kit", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843922_Indica-CO2-Oil.jpg"], prices: [50.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "20mg CBD Hemp", description: "Hemp capsules are produced from milled hemp plants which have been lightly heated in industrial ovens to maximize their beneficial compounds. This simple but effective product is often used as a daily supplement to improve health and vitality. Symptoms of inflammatory conditions such as arthritis are also known to lessen in severity. Typically, Cannabis capsules are used to maintain longer periods of medication in the body. Designed to treat nausea, neuropathic pain, anxiety, spasms, MS and other spasticity disorders without the mind altering properties of contemporary cannabis products. It also has neuro-protective and anti-cancer properties.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Hemp_CBD_Cap_20mg_DSC_3796.jpg"], prices: [3], price_labels: ["each"], thc: "0.0", cbd: "20.0", subspecies: "Indica", category: "Capsules", thumbnail: nil, stock: nil},
  {name: "10mg CO2 CBD", description: "Capsules produced with solvent free extracts formulated with coconut oil. These capsules have been produced using cannabis concentrations which have no solvents. By using CO2 derived extracts these capsules are considered by many to be the healthiest option. CO2 processing is the healthier choice for members who are sensitive to safe solvent extracted products.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_10mg_CloseUp_DSC_3871.jpg"], prices: [4], price_labels: ["each"], thc: "0.0", cbd: "10.0", subspecies: "Indica", category: "Capsules", thumbnail: nil, stock: nil},
  {name: "CBD Rick Simpson Oil 1Gram Tears(34% CBD / 340mg)", description: "Cannabis oils packaged in syringes are typically called Tears, easy to dispense and provide access to highly concentrated extractions in their raw un-diluted form. Small amounts of cannabis oil can be pushed out of the tip of the syringe and applied to food items, vaporized or taken orally/topically.\n        Produced for centuries in varied methods solvent extracted cannabis oils are pure un-diluted extracts which have been proven as beneficial for both acute an chronic pain conditions. The solvent used in these extracts is varied and will produce a slightly different consistency batch to batch depending on both the conditions of the production process and material.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_Syringe_40%25_Single_DSC_3864.jpg"], prices: [50.0], price_labels: ["each"], thc: "0.0", cbd: "34.0", subspecies: "", category: "Cannabis Oil (Tears)", thumbnail: nil, stock: nil},
  {name: "THC Rick Simpson Oil 1Gram Tears(67% THC)", description: "Cannabis oils packaged in syringes are typically called Tears, easy to dispense and provide access to highly concentrated extractions in their raw un-diluted form. Small amounts of cannabis oil can be pushed out of the tip of the syringe and applied to food items, vaporized or taken orally/topically.\n        Produced for centuries in varied methods solvent extracted cannabis oils are pure un-diluted extracts which have been proven as beneficial for both acute an chronic pain conditions. The solvent used in these extracts is varied and will produce a slightly different consistency batch to batch depending on both the conditions of the production process and material.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_Syringe_40%25_Single_DSC_3864.jpg"], prices: [40], price_labels: ["each"], thc: "67.0", cbd: "0.0", subspecies: "", category: "Cannabis Oil (Tears)", thumbnail: nil, stock: nil},
  {name: "Kush Oil  Battery &Amp; Charger Kit", description: "You can use this kit along with the Kush oil CO2 Refills that available on our website", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843911_kush-oil-battery.jpg"], prices: [25.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Blueberry  Toko Co2 Pen", description: "Toko offers sleek CO2 options for Cannabis vaporization. Supercritical CO2 extract formulated with live Cannabis terpenes for superior flavor and effect. All products are made with food grade materials only. Source products used for extraction are grown in a GMP and GPP environment without the use of pesticides and free of heavy metals:\r\n\r\n Made from Supercritical CO2 extracted cannabis oil\r\n Live cannabis plant terpenes extracted and formulated for superior flavor and product\r\n Products are processed, packaged and handled in a Good Production and Good Manufacturing Practices standard facility\r\n All products are made using only food grade formulations\r\n Source products used for extraction grown without the use of pesticides and free of heavy metals\r\n All products are laboratory analyzed to ensure potency and consistency.\r\n\r\nBlueberry\r\n\r\nBlueberry is an Indica dominant cannabis strain that is well-known for tasting like blueberries, the strain looks a little bit like blueberries too.\r\n\r\nThe taste is quite nice and is indeed reminiscent of blueberries. Its a high fruity note that sits up on the back of your tongue, the taste is greatly improved by smoking from a clean bong.\r\n\r\nThe buzz is very immediate, feeling it after only a few moments. At first you get a very nice euphoric rush of creativity and a bit of the giggles while not being to heady. That carries over into a very nice relaxation from head to toe, yet not putting you to sleep until you start to burn out.\r\n\r\nA great strain for experienced and new dabbers alike, make sure you get some of this amazing budder while you can!\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nAches and pains, insomnia, appetite stimulation, nausea, anxiety, stress, relaxation, and depression.\r\n\r\nTHC: 50%\r\n\r\nIngredients: Each pen contains 0.55 ml (0.5 g) of pure CO2 extracted cannabis oill. The pen is made of plastic and can be recycled.", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843903_toko-pen-blueberry.jpg"], prices: [55.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "1:1 Rick Simpson Oil 1Gram Tears(200mgCBD/THC)", description: "Cannabis oils packaged in syringes are typically called Tears, easy to dispense and provide access to highly concentrated extractions in their raw un-diluted form. Small amounts of cannabis oil can be pushed out of the tip of the syringe and applied to food items, vaporized or taken orally/topically.\n        Produced for centuries in varied methods solvent extracted cannabis oils are pure un-diluted extracts which have been proven as beneficial for both acute an chronic pain conditions. The solvent used in these extracts is varied and will produce a slightly different consistency batch to batch depending on both the conditions of the production process and material.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_Syringe_40%25_Single_DSC_3864.jpg"], prices: [40], price_labels: ["each"], thc: "20.0", cbd: "20.0", subspecies: "", category: "Cannabis Oil (Tears)", thumbnail: nil, stock: nil},
