  {name: "Master Kush Hash", description: "", retailer_id: 15, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [15.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Girl Scout Cookies  Toko Co2 Pen", description: "Toko offers sleek CO2 options for Cannabis vaporization. Supercritical CO2 extract formulated with live Cannabis terpenes for superior flavor and effect. All products are made with food grade materials only. Source products used for extraction are grown in a GMP and GPP environment without the use of pesticides and free of heavy metals:\r\n\r\n Made from Supercritical CO2 extracted cannabis oil\r\n Live cannabis plant terpenes extracted and formulated for superior flavor and product\r\n Products are processed, packaged and handled in a Good Production and Good Manufacturing Practices standard facility\r\n All products are made using only food grade formulations\r\n Source products used for extraction grown without the use of pesticides and free of heavy metals\r\n All products are laboratory analyzed to ensure potency and consistency.\r\n\r\nGirl Scout Cookies\r\n\r\nGirl Scout Cookies, or GSC, is an OG Kush and Durban Poison hybrid cross whose reputation grew too large to stay within the borders of its California homeland. With a sweet and earthy aroma, Girl Scout Cookies launches you to euphorias top floor where full-body relaxation meets a time-bending cerebral space. A little goes a long way with this hybrid, whose THC heights have won Girl Scout Cookies numerous Cannabis Cup awards. Patients needing a strong dose of relief, however, may look to GSC for severe pain, nausea, and appetite loss.\r\n\r\nParents: Durban Poison, OG Kush\r\nSimilar to: Blue Dream, Sour Diesel, Jack Herer, Grandaddy Purple, OG Kush\r\n\r\nFlavors: Sweet, earthy, pungent\r\nEffects: Lazy, euphoric, sleep, happy, hungry\r\nMedical: Depression, insomnia, anxiety, lack of appetite\r\nUsed to help with: Anxiety, ADD/ADHD, migraines, bipolar disorder, PTSD\r\n\r\nContains: 274 mg (68%) of THC, 1.82 mg per draw.\r\n\r\nIngredients: Each pen contains 0.4 ml (0.44 mg) of pure CO2 extracted cannabis oil processed with food grade alcohol. The pen is made of plastic and can be recycled.", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843888_toko-pen.jpg"], prices: [55.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Quarry  Co2 Honey Oil  Grape Kush", description: "Lab-tested to contain 80% THC\r\nSmoking oils are non decarboxylated cannabis extracts. Smoking oils are most effective where immediate absorption is needed. Green Oil is a natural extract very high in chlorophyll. Cherry Oil is charcoal filtered to remove most chlorophyll. Honey Oil is filtered and winterized to remove both chlorophyll and waxes in addition to other plant material. Smoking oils can be smoked in a pipe, vaporized, rolled in a joint, or hot knifed. Use of cannabinoid medicines should always be used under the advice of a physician.\r\n\r\nGrape Kush\r\nMixing the robust nature of Pre98 Bubba with the refreshing notes of Grape Romulan, Grape Kush from Cali Connection is a hybrid of quality and quantity. This feminized incarnation is a super quick grower with a flowering time of just 8 weeks. Predominantly sativa in nature (60%/40%), Grape Kush possesses the best of both worlds. The effects are long-lasting and powerful, inducing euphoric head effects and a relaxed body.\r\n\r\nParents: Pre-98 Bubba Kush, Romulan Grapefruit\r\n\r\nFlavors: Grape, berry, sweet\r\nEffects: Relaxed, euphoric, happy, uplifted, sleepy\r\nMedical: Stress, depression, pain, insomnia, inflammation", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843867_Grape-Kush.jpg"], prices: [70.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Quarry  Co2 Hash Oil  (Pennywise Cbd)", description: "Lab-tested to contain 69% Cannabinoids\r\nSmoking oils are non decarboxylated cannabis extracts. Smoking oils are most effective where immediate absorption is needed. Green Oil is a natural extract very high in chlorophyll. Cherry Oil is charcoal filtered to remove most chlorophyll. Honey Oil is filtered and winterized to remove both chlorophyll and waxes in addition to other plant material. Smoking oils can be smoked in a pipe, vaporized, rolled in a joint, or hot knifed. Use of cannabinoid medicines should always be used under the advice of a physician.\r\n\r\nPennywise\r\nPennywise is a high-CBD indica cross between Harlequin and Jack the Ripper, a combination that lends this strain its killer clown name. Four phenotypes of this Stephen King-inspired strain exist, some of which have fingerlike buds while others appear more round. Notes of coffee and pepper lift from the purple-fringed flowers with undertones of lemon and bubblegum.\r\n\r\nRich in the therapeutic compound CBD, Pennywise is especially effective in treating arthritis, PTSD, epilepsy, neurological disorders, and cancer symptoms. It contains a 1:1 ratio of CBD and THC, so the psychoactive effects are milder and more relaxing. Jack the Rippers cerebrally focused effects are detectable in Pennywises genes as euphoria and mental clarity take over with an invigorating buzz. Pennywise flowers in 60 to 67 days and is suitable for either indoor or outdoor gardens.\r\n\r\nParents: Jack the Ripper, Harlequin\r\n\r\nFlavors: Earthy, woody, spicy/herbal\r\nEffects: Relxaed, happy, focused, euphoric, uplifted\r\nMedical: Stress, depression, pain, inflammation, insomnia", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843858_Quarry_-_CO2_Honey_Oil_-_pennywise.jpg"], prices: [75.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Bubba", description: "Bubba Kush is an indica strain that has gained notoriety in the U.S. and beyond for its heavy tranquilizing effects. Sweet hashish flavors with subtle notes of chocolate and coffee coming through on the exhale, delighting the palate as powerful relaxation takes over. From head to toe, muscles ease with heaviness as dreamy euphoria blankets the mind, crushing stress while coercing happy moods. Bubba Kush exhibits a distinctive, bulky bud structure with hues that range from forest green to pale purple.\r\n\r\nBubbas stocky plant stature and bulky bud structure suggest Afghani descent, but its genetic origins arent certain. The breeder whom this strain was named after states that Bubba Kush emerged just after 1996, when an OG Kush hybrid pollinated an unknown indica strain obtained in New Orleans. The mother plant was supposedly Northern Lights, but the genetically ambiguous indica was simply called Bubba. Bubba Kush has flourished from its California roots ever since.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3727624_Bubba.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Premium Shatter", description: "A mix of small buds and shake from our various strains. Exceptional quality at an exceptional price!", retailer_id: 6, images: ["./assets/img/shatter_hover.png"], prices: [18], price_labels: ["each"], thc: "15.0", cbd: "5.0", subspecies: "Hybrid", category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Dub**Sale**", description: "Coming from the ever-popular Sour Diesel, OG Kush, and Chemdawg family tree, Dub has a solid reputation for its potency. This hybrid produces a well-balanced effect, creating a euphoric, happy...", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3866264_lf_a_dub.jpg"], prices: [7.0, 14.0, 24.5, 49.0, 98.0, 196.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Alien Dog", description: "Descending from Northern California and Afghanistan genetics, Alien Dawg is a cross between Chemdawg and Alien Technology with a THC content of up to 20%. With a sour and pungent odor, Alien Dawg has a light, bitter taste and presents brilliant mind and body effects.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/indica.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "24.0", cbd: "1.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "MK Ultra", description: "Named after the methods of mental manipulation employed by the CIAs Project MKUltra, this indica-dominant strain stands apart due to its powerful cerebral effects. A cross between mostly-sativa hybrid OG Kush and indica G-13, this strain is bred by TH Seeds and won 1st place Indica at the High Times Cannabis Cup in 2003 and 2nd place in 2004. Indoor growing is facilitated by the plants short stature, and its above average yield delivers particularly sticky, dense, pungent flowers. MK Ultra is renowned for its hypnotic effects that are fast-acting and best used when strong medication is desired. As evidenced by its collection of awards, this indica is one of the strongest in the world. It might be best for a day when not getting off the couch would be fine.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/indica.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "18.0", cbd: "1.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "LA Confidential", description: "LA Confidential is known as a very popular and successful strain. Its buds have a frosty, lime green appearance and little purple leaves. The taste is smooth and piney, with a classic skunky aroma that does not linger for too long. Overall, LA Confidential is a well-rounded strain that delivers a fast-approaching sensation that is both psychedelic and super calming on the mind and body. For newer patients seeking relief, LA Confidential can both lull you to sleep and treat acute pain.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/indica.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "21.0", cbd: "1.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "The Doctor", description: "Bred by Green House Seeds, The Doctor is an indica-dominant strain designed to treat a myriad of unpleasant symptoms such as pain, nausea, appetite loss, and insomnia. Its name also comes in tribute to the motorcycle racer Valentino Rossi, also called The Doctor. Heavy sedating effects act fast, leaving you feeling pacified and calm. Earthy flavors soured by skunky, fruity notes arrive on the inhale, making their exit with the taste of hashy spice. Great White Shark, Super Skunk, and an unnamed South Indian parent lend The Doctor its genetic blueprint.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/indica.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "24.0", cbd: "1.5", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "Night Nurse", description: "Night Nurse is an indica-dominant strain from Reeferman Seeds that combines genetics from BC Hash Plant, Harmony, and Fire OG. Its commonly used to fight anxiety, stress, insomnia and chronic pain. Are you having trouble sleeping? This 80/20 indica provides a polite balance of relaxing cerebral and body effects, making this the perfect nighttime sleeping aid.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/indica.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "20.0", cbd: "1.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "Harlequin", description: "Harlequin is a 75/25 sativa-dominant strain renowned for its reliable expression of CBD. A descendant of Colombian Gold, a Nepali indica, and Thai, and Swiss landrace strains, you can depend on Harlequin to provide clear-headed, alert sativa effects. Unlike most high-CBD strains, Harlequin almost always develops a CBD:THC ratio of 5:2, making this strain one of the most effective out there for treatment of pain and anxiety, as CBD counteracts THCs paranoia while amplifying its painkilling properties. Flavors can range from earthy musk to sweet mango, but without a doubt, what draws crowds to Harlequin is its ability to relax without sedation, and to relieve without intoxication.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/sativa.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "2.0", cbd: "7.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Ice Cream", description: "This indica-dominant 60/40 strain bred by Paradise Seeds creates a great hybrid balance of effects. Much like the frozen treat, Ice Cream has a smooth, creamy taste.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "18.0", cbd: "7.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Blue Widow", description: "Blue Widow is a favorite strain that provides consumers with both uplifting and calming effects. These flowers will have a strong sweet aroma that may also include sour citrus or pine. The buds can be colorful, with tints of blue and purple, and should have a coat of long orange hairs. Slightly indica-dominant, this Widow plays against type, growing taller than most indicas and providing more mental, heady effects. In higher doses, the blissful relaxation this strain provides may lead to drowsiness and help you get to sleep. A cross between Blueberry and White Widow, Blue Widow is sometimes also called Berry White, White Berry, and Blue Venom.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "18.0", cbd: "1.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Critical Plus", description: "Critical Plus is a balanced hybrid cross between Skunk and Big Bud.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "22.0", cbd: "1.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "ChemDawg", description: "Chemdawg has developed quite the name for itself over the years. Between its mysterious origin, ambiguous genetics, and the plethora of successful crosses the strain has produced, Chemdawg has practically secured itself a permanent place in the cannabis hall of fame. The original source of powerhouse strains like Sour Diesel and OG Kush, Chemdawg is known for its distinct, diesel-like aroma. Pungent and sharp, youll be able to smell this hybrid from a mile away. Cannabis newbies be warned: Chemdawg tends to be very potent. Depending on grow conditions, this strain tends to have THC levels of 15-20%. Consumers can expect to have a very cerebral experience, coupled with a strong heavy-bodied feeling.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "25.0", cbd: "0.1", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Death Bubba", description: "", retailer_id: 12, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [13.0, 40.0, 75.0], price_labels: ["Gram", "Eighth", "Quarter"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Confidential Cheese", description: "Confidential Cheese by DNA Genetics is a crossbred hybrid of Cheese and LA Confidential. This indica-dominant strain has pale green crystal-covered buds with a sour cheese aroma inherited from its parent. Medical patients have used the potent and heavy effects of Confidential Cheese to treat severe pain, insomnia, and lost appetite. For growers, this strain finishes flowering in 8 to 9 weeks with moderate yields.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "25.0", cbd: "1.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Kushage", description: "This sativa-dominant marijuana hybrid strain was developed to be a resilient, hardy grower and won its breeders at TH Seeds 3rd place in the sativa category at the 2005 High Times Cannabis Cup. Kushage plants come from OG Kush and SAGE parents, and like many sativas, they have a slightly longer flowering time at 10-11 weeks. These plants have lots of branches with dark green leaves, but its buds are light green and smell like fresh cut pine. Kushage is a good choice for a cerebral buzz and might just get those creative juices flowing.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "20.0", cbd: "1.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Chem Valley Kush", description: "Chem Valley Kush is a sativa-leaning hybrid cross between Chemdawg and SFV OG Kush bred by Cali Connection.", retailer_id: 4, images: ["https://s3.amazonaws.com/media.nimbusfly.co/default/hybrid.jpg"], prices: [8.5, 29.75, 59.5, 119, 238], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "22.0", cbd: "1.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Quarry  Co2 Honey Oil  Girl Scout Cookies", description: "Lab-tested to contain 80% cannabinoids\r\nSmoking oils are non decarboxylated cannabis extracts. Smoking oils are most effective where immediate absorption is needed. Green Oil is a natural extract very high in chlorophyll. Cherry Oil is charcoal filtered to remove most chlorophyll. Honey Oil is filtered and winterized to remove both chlorophyll and waxes in addition to other plant material. Smoking oils can be smoked in a pipe, vaporized, rolled in a joint, or hot knifed. Use of cannabinoid medicines should always be used under the advice of a physician.\r\n\r\nGirl Scout Cookies\r\nGirl Scout Cookies, or GSC, is an OG Kush and Durban Poison hybrid cross whose reputation grew too large to stay within the borders of its California homeland. With a sweet and earthy aroma, Girl Scout Cookies launches you to euphorias top floor where full-body relaxation meets a time-bending cerebral space. A little goes a long way with this hybrid, whose THC heights have won Girl Scout Cookies numerous Cannabis Cup awards. Patients needing a strong dose of relief, however, may look to GSC for severe pain, nausea, and appetite loss.\r\n\r\nParents: Durban Poison, OG Kush\r\nSimilar to: Blue Dream, Sour Diesel, Jack Herer, Grandaddy Purple, OG Kush\r\n\r\nFlavors: Sweet, earthy, pungent\r\nEffects: Lazy, euphoric, sleep, happy, hungry\r\nMedical: Depression, insomnia, anxiety, lack of appetite\r\nUsed to help with: Anxiety, ADD/ADHD, migraines, bipolar disorder, PTSD", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843836_Quarry_-_CO2_Honey_Oil_-_Girl_Scout_Cookies1.jpg"], prices: [70.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Purely  500mg Thc Phoenix Tears", description: "Decarboxylated cannabis oil extracted with triple distilled medical grade isopropyl alcohol, MCT oil.\r\n1 oral syringe contains 3 ml of Phoenix Tears in MCT Oil.\r\n\r\nStart with a drop half the size of a grain of rice, two or three times a day. Gradually increase dosage at a rate no higher then 0.5 mg of main active ingredient (THC or CBD) per pound of body weight in order to avoid experiencing side effects (drowsiness, impaired motor skills, euphoria and/or anxiety). High dose regiments typically used for instances involving serious pain, sleep disorders, cancer and/or epilepsy tend to be within 1 to 2 mg of main active ingredient per pound of body weight per day.\r\n\r\n* It is not recommended to use any Purely Medicinal products for rectal application. Anyone using them in this way does so at their own risk.\r\n\r\n** Products that contain MCT should not be vaped or smoked.\r\n\r\nPhoenix Tears: The Cancer Cure the Government Doesnt Want You to Know About", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843801_purely-500mg.jpg"], prices: [30.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Purely  200mg Phoenix Tears Halleys Comet", description: "Hayleys Comet is a patented cultivar with a 1:1 THC:CBD ratio that was found, tested and continues to be researched by Dr. Paul Hornby in Vancouver with the intention of making it available to all patients.\r\n\r\n1 oral syringe contains 3 ml of Halleys Comet in MCT Oil (derived from coconut oil) and contains 202 mg of CBD and 205 mg of THC per unit.\r\n\r\nStart with a drop half the size of a grain of rice, two or three times a day. Gradually increase dosage at a rate no higher then 0.5 mg of main active ingredient (THC or CBD) per pound of body weight in order to avoid experiencing side effects (drowsiness, impaired motor skills, euphoria and/or anxiety). High dose regiments typically used for instances involving serious pain, sleep disorders, cancer and/or epilepsy tend to be within 1 to 2 mg of main active ingredient per pound of body weight per day.\r\n\r\n* It is not recommended to use any Purely Medicinal products for rectal application. Anyone using them in this way does so at their own risk.\r\n\r\n** Products that contain MCT should not be vaped or smoked.", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843786_purely-haleyscommet.jpg"], prices: [60.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Purely  200mg Cbd Phoenix Tears", description: "1 oral syringe contains 3 ml. Start with a drop half the size of a grain of rice, two or three times a day. Gradually increase dosage at a rate no higher then 0.5 mg of main active ingredient (THC or CBD) per pound of body weight in order to avoid experiencing side effects (drowsiness, impaired motor skills, euphoria and/or anxiety). High dose regiments typically used for instances involving serious pain, sleep disorders, cancer and/or epilepsy tend to be within 1 to 2 mg of main active ingredient per pound of body weight per day.\r\n\r\nCBD, or cannabidiol, is one of over 100 identified cannabinoids (a special class of chemical compounds) in the cannabis plant. CBD and THC, or tetrahydrocannabinol, are the two primary compounds that have been investigated in medical research.\r\n\r\nOf all of CBDs possible applications, the one garnering the most attention is the dramatic effect it has on young patients suffering from severe forms of epilepsy. The story of Charlotte Figi, a young girl who went from 300 seizures a week to just a few with daily doses of a CBD tincture, has turned CBD into a media sensation and industry buzzword.\r\n\r\nStudies have shown CBD to have the following notable therapeutic benefits:\r\n\r\nAnti-inflammation\r\nAnti-pain\r\nAnti-anxiety\r\nAnti-psychosis\r\nAnti-spasm\r\n\r\nIn addition, there is evidence that CBD may act as a neuroprotectant  that is, able to stem neurological damage following strokes and in neurodegenerative diseases such as Alzheimers and Parkinsons  and may play a role in neurogenesis, the creation of new brain cells.\r\n\r\nNumerous studies have shown CBDs promise in the treatment of a wide range of conditions, including but not limited to:\r\n\r\nArthritis\r\nDiabetes\r\nAlcoholism\r\nMultiple sclerosis\r\nSchizophrenia\r\nPTSD\r\nAlzheimers\r\nCancer\r\nEpilepsy\r\n\r\nCBD acts on different pathways than THC in the body, complementing THCs effects on the same symptoms when administered together. In addition, CBD counters the psychoactivity of THC, making it ideal for patients who cannot handle too much THC and who respond sufficiently to CBD for their medical condition.\r\n\r\n* It is not recommended to use any Purely Medicinal products for rectal application. Anyone using them in this way does so at their own risk.\r\n\r\n** Products that contain MCT should not be vaped or smoked.", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843760_purely-cbd.jpg"], prices: [60.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Live Resin (Crumble)  Quantum Kush", description: "Butane extraction extracted from fresh plants at low temp, high pressure BHO (butane hash oil) then vacuumed for 36 hours.\r\n\r\nQuantum Kush\r\nIf you are looking for a strain with ridiculously high THC content, Quantum Kush may just be the bud for you. Homegrown Natural Wonders originally produced this mix of Sweet Irish Kush and Timewreck, a combination that passes on a complex aroma that is both earthy and sweet. While the effects are strong, Quantum Kush provides clear-headed and relaxing effects perfect for those dealing with appetite loss, nausea, or depression.\r\n\r\nParents: Timewreck\r\n\r\nFlavors: Sweet, earthy, pungent\r\nEffects: Uplifted, relaxed, euphoric, happy, creative\r\nMedical: Depression, stress, pain, fatigue, headaches", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843729_DSC_0376.JPG"], prices: [60.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
