  {name: "Smores Brownie", description: "A mix of small buds and shake from our various strains. Exceptional quality at an exceptional price!", retailer_id: 6, images: ["./assets/img/smoresbrownie.png"], prices: [18], price_labels: ["each"], thc: "15.0", cbd: "5.0", subspecies: "Hybrid", category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Mku Budder", description: "The MKU strain itself is bred from the O.G Kush and the G-13. Indica dominates the effects of this medical marijuana strain.\r\n\r\nIt sends the smokers in a sensational high, which starts with a body buzz and then dies down to a calm. The smoker is couch locked for a while after smoking the MKU.\r\n\r\nThe positive effects of this strain make it a viable treatment for depression because it releases endorphins in the brain, which makes the smokers euphoric and uplifts the spirits.\r\n\r\nIt also calms the nerves hence it is suitable for people suffering from pain related to neuropathy or bodily aches. It relaxes the body and dissipates all the stiffness in the joints and muscles making the person feel invigorated.\r\n\r\nPatients suffering from stress and anxiety also take this brand of budder as it soothes the mind and sends all negative feelings away.\r\n\r\nThe MKU with each inhale and exhale tastes like a citrusy fruit, soothing herbs with a zing of spices. It is a treat for the taste buds and the nose as well. The aroma is very herbal and does not bother the olfactory senses.\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nAches and pains, insomnia, appetite stimulation, nausea, anxiety, stress, relaxation, and depression.\r\n\r\nTHC: 81%\r\n\r\nStrain: Dominant Indica", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843715_MKU_Budder.JPG"], prices: [50.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "El Muerte Budder", description: "It is one of our strongest Indica strains by far, with a high THC content.\r\n\r\nStrongly recommended for anyone in lots of pain and people with insomnia, anxiety, ADD/ADHD, and PTSD.\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nAches and pains, insomnia, appetite stimulation, nausea, anxiety, stress, relaxation, and depression.\r\n\r\nTHC: 81%\r\n\r\nStrain: Dominant Indica", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843706_El_Muerte_Budder.JPG"], prices: [50.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Bubba Kush Budder", description: "Bubba Kush is an Indica dominant and heavy strain\r\n\r\nVery relaxing. Smooth on the throat.\r\n\r\nVery good head high\r\n\r\nRecommended for:\r\n\r\nInsomnia, appetite stimulation\r\n\r\nTHC: 87%\r\n\r\nStrain: Dominant Indica", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843675_Bubba_Budder.JPG"], prices: [50.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Blueberry Budder", description: "Blueberry is an Indica dominant cannabis strain that is well-known for tasting like blueberries, the strain looks a little bit like blueberries too.\r\n\r\nThe taste is quite nice and is indeed reminiscent of blueberries. Its a high fruity note that sits up on the back of your tongue, the taste is greatly improved by smoking from a clean bong.\r\n\r\nThe buzz is very immediate, feeling it after only a few moments. At first you get a very nice euphoric rush of creativity and a bit of the giggles while not being to heady. That carries over into a very nice relaxation from head to toe, yet not putting you to sleep until you start to burn out.\r\n\r\nA great strain for experienced and new dabbers alike, make sure you get some of this amazing budder while you can!\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nAches and pains, insomnia, appetite stimulation, nausea, anxiety, stress, relaxation, and depression.\r\n\r\nTHC: 85%", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843643_Blueberry_Budder2.JPG"], prices: [50.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Strawberry Shatter", description: "Strawberry shatter is a concentrate of a mostly sativa cannabis strain with a pungent fruity scent and uplifting effects.\r\n\r\nConsumers prone to anxiety choose Strawberry for its stress-relieving qualities without the jarring paranoia common among high THC strains. Comfortable and relaxing, Strawberry brings physical and mental relief to patients treating symptoms mild or severe.\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nStress, anxiety, relaxation\r\n\r\nTHC: 86%\r\n\r\nStrain: Sativa", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843613_Strawberry_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Pine Tar Shatter", description: "Pine Tar Kush stems from a family of pure Indica genetics native to Pakistan. This cannabis strain is nearly unaltered from its original genetic form and expresses itself with a skunky aroma. The rich Kush flavor of pine mixes with sweet undertones that give way to Pine Tar Kushs calming yet talkative buzz.\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nStress, relaxation, and depression.\r\n\r\nTHC: 89%\r\n\r\nStrain: Indica", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843591_Pine_Tar_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
