  {name: "Girl Scout Cookies", description: "With a sweet and earthy aroma, Girl Scout Cookies launches you to euphorias top floor where full-body relaxation meets a time-bending cerebral space. A little goes a long way with this hybrid, whose THC heights have won Girl Scout Cookies numerous Cannabis Cup awards.", retailer_id: 6, images: ["./assets/img/Girl_Scout.jpg", "./img/Jays-PreRolls-Joints-About-Graphic-2.jpg"], prices: [15, 45, 80, 150, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "26.5", cbd: "3.0", subspecies: "Hybrid", category: "Flowers", thumbnail: nil, stock: nil},
  {name: "Sour Diesel", description: "Sour Diesel, sometimes called Sour D, is an invigorating sativa named after its pungent, diesel-like aroma. This fast-acting strain delivers energizing, dreamy cerebral effects that have pushed Sour Diesel to its legendary status. Stress, pain, and depression fade away in long-lasting relief that makes Sour Diesel a top choice among medical patients.", retailer_id: 6, images: ["./assets/img/Sour_Diesel.jpg", "./img/Jays-PreRolls-Joints-About-Graphic-2.jpg"], prices: [15, 45, 80, 150, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "20.5", cbd: "1.0", subspecies: "Sativa", category: "Flowers", thumbnail: nil, stock: nil},
  {name: "Train Wreck", description: "Trainwreck is a mind-bending hybrid with potent sativa effects that hit like a freight train. Mexican and Thai sativas were bred with Afghani indicas to produce this Northern California staple, passing on a sweet lemon and spicy pine aroma. Trainwreck begins its speedy hurtle through the mind with a surge of euphoria, awakening creativity and happiness.", retailer_id: 6, images: ["./assets/img/Sour_Diesel.jpg", "./img/Jays-PreRolls-Joints-About-Graphic-2.jpg"], prices: [15, 45, 80, 150, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "18.5", cbd: "8.0", subspecies: "Hybrid", category: "Flowers", thumbnail: nil, stock: nil},
