  {name: "Og Kush Shatter", description: "OG Kush Shatter is a concentrate of OG Kush bud. OG Kush is cherished for its ability to crush stress under the weight of its heavy euphoria.\r\n\r\nIt carries an earthy pine and sour lemon scent with woody undertones, an aroma that has become the signature of OG Kush varieties and descendants. With OG Kush, patients most commonly cite improvements in migraines, ADD/ADHD, and stress disorders.\r\n\r\nRecommended for:\r\n\r\nMigraines, ADD/ADHD, and stress disorders.\r\n\r\nTHC: 87%\r\n\r\nStrain: Indica", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843579_OG_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Khalifa Kush Shatter", description: "Khalifa Kush Shatter is the concentrate of a hybrid strain that was bred specifically for the rap artist Wiz Khalifa, who claims it descended from an OG strain. It has sour lemon and pine, with an active cerebral buzz ideal for morning and daytime use.\r\n\r\nRecommended for:\r\n\r\nStress, relaxation, and depression.\r\n\r\nTHC: 89%\r\n\r\nStrain: Hybrid", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843568_Khalifa_Shatter1.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "CO2 60% CBD(600mg) Tears", description: "Cannabis oils packaged in syringes are typically called Tears, easy to dispense and provide access to highly concentrated extractions in their raw un-diluted form. Small amounts of cannabis oil can be pushed out of the tip of the syringe and applied to food items, vaporized or taken orally/topically.\n        These oils have been produced using CO2 extraction. Carbon dioxide under extreme pressure will act as an effective agent to extract the active compounds in cannabis. This method uses no hydrocarbon based inputs, as such it is considered by many to produce the safest product with no chance of residual solvents. ", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_Syringe_40%25_Single_DSC_3864.jpg"], prices: [90.0], price_labels: ["each"], thc: "0.0", cbd: "60.0", subspecies: "", category: "Cannabis Oil (Tears)", thumbnail: nil, stock: nil},
