  {name: "Vaporizer Starter Kit", description: "Dressed all in black with a touch of gold, the classic ALAIR Vaporizers are well-suited to any occasion. Each vaporizer comes with a filled cartridge that will last 150+ draws and USB charger adaptor.", retailer_id: 1, images: ["https://static1.squarespace.com/static/56ad28197da24fafb23f972c/56ad354489a60aa6dae3a3c8/582b832615d5db457f0c55f9/1479246633034/279A60111.jpg?format=1500w", "https://static1.squarespace.com/static/56ad28197da24fafb23f972c/56ad354489a60aa6dae3a3c8/56cbf7f11bbee05e52d8373e/1479246719635/279A6219.jpg?format=1500w", "https://static1.squarespace.com/static/56ad28197da24fafb23f972c/56ad354489a60aa6dae3a3c8/582b834415d5db457f0c580c/1479246719636/IMG_0595.jpg?format=1500w"], prices: [100], price_labels: ["each"], thc: "68.0", cbd: "0.35", subspecies: "", category: "Vaporizers", thumbnail: nil, stock: nil},
  {name: "El Heffe Shatter", description: "El Heffe Shatter is a concentrate of a primarily Indica strain with high THC content that falls between 88% and 93%.\r\n\r\nThe smell is hash with earthy undertones. El Heffe delivers an exceptional blend of spicy, lemony and pine flavors that will keep you coming back for more after each dab.\r\n\r\nThe strain is known for offering mind relief unlike any other. It may be strong but it is not strong enough to completely knock you out for the rest of the night.\r\n\r\nThe high is calming and relaxing and primarily offers a body buzz that calms the senses which may cause you to exhibit symptoms of couch-lock. Keeping this in mind, you should keep in mind that its effects are primarily beneficial for individuals suffering from crams and muscle spasms.\r\n\r\nBut that is not all, as it is just as effective at treating other severe medical conditions like anorexia, depression, anxiety and ADHD.\r\n\r\n \r\n\r\nRecommended for:\r\n\r\nAnorexia, depression, anxiety and ADHD.\r\n\r\nTHC: 88%\r\n\r\nStrain: Sativa", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843525_El_Heffe_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "El Muerte Shatter", description: "El Muerte Shatter is a concentrate of an extremely heavy Indica strain, with amazing sedating effects for bedtime.\r\n\r\nThis strain would also do great for Insomnia, Pain Management, Arthritis, Body Aches and Headaches.\r\n\r\nRecommended for:\r\n\r\nInsomnia, Pain Management, Arthritis, Body Aches and Headaches.\r\n\r\nTHC: 91%\r\n\r\nStrain: Sativa", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843540_El_Muerte_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Bubba God Resin", description: "Bubba God Resin is a concentrate of an Indica cross between two hefty parent strains, Bubba Kush and God Bud.  Indica lovers will appreciate the tranquilizing qualities Gods Bubba has to offer, especially those treating pain and insomnia.", retailer_id: 9, images: ["https://images.weedmaps.com/pictures/listings/338/246/081/large/3843497_Bubba_God_Resin_Shatter.JPG"], prices: [45.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Blue Dream", description: "Blue Dream, a sativa-dominant hybrid originating in California, has achieved legendary status among West Coast strains. Crossing a Blueberry indica with the sativa Haze, Blue Dream balances full-body relaxation with gentle cerebral invigoration. Novice and veteran consumers alike enjoy the level effects of Blue Dream, which ease you gently into a calm euphoria. Some Blue Dream phenotypes express a more indica-like look and feel, but the sativa-leaning variety remains most prevalent.\r\n\r\nWith a sweet berry aroma redolent of its Blueberry parent, Blue Dream delivers swift symptom relief without heavy sedative effects. This makes Blue Dream a popular daytime medicine for patients treating pain, depression, nausea, and other ailments requiring a high THC strain. ", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3866397_blue-dream__primary_d565.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Landcruiser Seawarp **Sale**", description: "It is one of British Columbia's most popular outdoor strains. It is a three-way Indica-dominant hybrid cross between Sea Level, Ben Johnson and Texada Timewarp.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3693623_Seawarp.jpg"], prices: [7.0, 14.0, 24.5, 49.0, 98.0, 196.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Grape God **Special Edition**", description: "Grape God is an indica-dominant hybrid that combines God Bud and Grapefruit genetics. As its name suggests, this strain has a sweet grape aroma with earthy notes that activate on the exhale. Powerful, long-lasting euphoria knocks out stress, leaving your mood elevated and your body relaxed. ", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3731683_Grape_God.jpg"], prices: [13.0, 26.0, 45.5, 90.0, 180.0, 360.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Pink Five O", description: "Pink Five O has an energized effect on your system, making you feel creative and euphoric. It makes you happy and clear-headed at the same time. It is a blend of 85 percent Sativa and 15 percent Indica. As it is a Sativa dominant strain, it does have certain psychoactive effects on you. It has an airy feel to it and has light green leaves that are covered with brown hairs. Pink Five O as a 22.6 percent to 24 percent THC level that makes it a strong marijuana strain. Its CBD level is around 0.46 percent. It has a lovely aroma that is an amalgamation of sweet pine and pear scents. The taste is quite pleasant as well and is a blend of strong earthy and sweet flavours, including pine and pear flavours. The pungent aroma of Pink Five O gets straight to your head and produces a powerful buzz on your body. This strain excellent for the anxiety patients as it relieves their headaches, stress and other anxiety symptoms. In addition to that, you can use it for soothing your irritability and depression as well. Migraines, chronic and mild pains and nausea can also be mitigated by the use of Pink Five O.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3866386_pink-panther-sun-grown.jpg"], prices: [13.0, 26.0, 45.5, 91.0, 182.0, 364.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
