  {name: "Dank Commander Sativa", description: "Dank Commander is a uniquely scented sative which has typical OG hints of lemon-lime fuel and kush combined with pine, alpine flowers and skunk. Users can expect a relaxing body buzz with a mellowing cerebral high that will leave them in a state of euphoric zen.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Green_Crack_DSC_5663.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "25.0", cbd: "0.3", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Jack Herer", description: "Sativa dominant strain that has gained much renown as its namesake, the marijuana activist and author of The Emporor Wears No Clothes. Combining a Haze hybrid with a Northern Lights and Shiva Skunk cross, Creates and captures both the cerebral elevation associated with sativa and the heavy resin production of indica's. This staple strain has happy, uplifting, and creative head space perfect for patients in need of stress, pain or depression relief. ", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Jack_Herer_DSC_3771.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "MK Ultra", description: "Named after the methods of mental manipulation employed by the CIAs Project MKUltra, this indica-dominant strain stands apart due to its powerful cerebral effects. A cross between mostly- sativa OG kush and indica G-13. Renewed for its hypnotic effects that are fast acting and best used when strong medication is desired. This indica is one of the strongest in the world and might be best for a day when not getting off the couch would be fine.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/MK+Ultra_DSC_1625.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Nebula", description: "Its name means Starcloud highly described as intense and almost psychedelic. With a THC coating unlike most buds, known to smell and taste like honey, and a head and body buzz thats favourable for stress, pain and fatigue.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Nebula_DSC_3770.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "OG Kush", description: "Makes up the genetic backbone of West Coast cannabis varieties, but in spite of its ubiquity its genetic origins remain an mystery. Popular myth maintains that Chemdawg and Hindu Kush parented OG Kush, passing on the distinct Kush bud structure we see in many strains today. However, nobody is fully clear as to when in the Early 90s first propagators of the seed. Still today is cherished for its ability to crush stress under the weight of its heavy euphoria. It carries an earthy pine and sour lemon scent with woody undertones, an aroma that has become the signature of OG Kush varieties and descendants. With OG Kush, patients most commonly cite improvements in migraines, ADD/ADHD, and stress disorders.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/OG+Kush_DSC_1618.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Indica", category: "Indica", thumbnail: nil, stock: nil},
  {name: "Sourlope", description: "A sativa dominant cross know for its uplifting and energetic effects. Believed to be a hybrid of NYC Diesel and Cannalope Haze genetics, Sourlope creates a mix of tropical flavours that are sharpened by a strong diesel note. The elevated mood creative head space attributed to this strain make it a great choice for daytime use and when combating stress and fatigue.", retailer_id: 6, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Sourlope_DSC_5680.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "0.0", cbd: "0.0", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Super Silver Haze", description: "By Crossing the genetics of Skunk, Northern Lights, and Haze, we are left with a beautiful, sticky sativa blend that boasts an energetic, long lasting body high. The uplifting effects are a great remedy for high stress levels or when suffering from a lack of appetite or nausea. Considered to be good for headaches, migraines, and producing a calming, uplifting, clearheaded feeling of content.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Purple+Candy_DSC_1637.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "19.0", cbd: "2.43", subspecies: "Sativa", category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Skywalker OG", description: "Skywalker OG is a potent indica-dominant hybrid strain that may just take you to a galaxy far, far away. No Sith genetics herethis plant is a cross between Skywalker and OG Kush and has the strong aroma characteristic to kush strains that includes a spicy herbal scent tinged with jet fuel. This strain makes relaxation your only mission, and some users report strong body effects that include mild tingling and numbness. If pain and physical limitations are the issue, Skywalker OG is here to rescue you. The galaxy also holds a sativa dominant variety of Skywalker that is also often referred to as Skywalker OG or Sativa OG.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Mendocino+Purps_DSC_1641.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "21.5", cbd: "0.34", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
