  {name: "Okanagan Valley Harvest Pineapples(70mg THC)", description: "Okanagan Valley Harvest edibles are delicious and healthy options for consuming cannabis, without sulphites, allergens and gluten free. We recommend medicating with edibles for a long lasting and therapeutic full-body effect. Edibles represent a great alternative to capsules and increase bioavailability of cannabinoids by introducing healthy fats and oils that help facilitate absorption of cannabinoids. Conveniently packaged, easy to titrate with and store/freeze for later use. Each bag contains several discrete servings so that measuring and weighting is unnecessary. Pineapple rings give a healthy option for people who are trying to avoid the sugars and carbohydrates contained in traditional cannabis baking. Medicated with premium cannabis oils using our proprietary process insure even distribution of active compounds.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Okanaga_Valley_Harvest_Pineapple_DSC_3892.jpg"], prices: [20], price_labels: ["each"], thc: "70.0", cbd: "0.0", subspecies: "", category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Frost", description: "By Crossing the genetics of Skunk, Northern Lights, and Haze, we are left with a beautiful, sticky sativa blend that boasts an energetic, long lasting body high. The uplifting effects are a great remedy for high stress levels or when suffering from a lack of appetite or nausea. Considered to be good for headaches, migraines, and producing a calming, uplifting, clearheaded feeling of content.", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Super_Silver_Haze_2_DSC_3998.jpg"], prices: [10, 35, 70, 140, 280], price_labels: ["Gram (1g)", "Eighth (3.5g)", "Quarter (7g)", "Half (14g)", "Ounce (28g)"], thc: "19.0", cbd: "2.43", subspecies: "Hybrid", category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "CO2 40% CBD(400mg) Tears", description: "Cannabis oils packaged in syringes are typically called Tears, easy to dispense and provide access to highly concentrated extractions in their raw un-diluted form. Small amounts of cannabis oil can be pushed out of the tip of the syringe and applied to food items, vaporized or taken orally/topically.\n        These oils have been produced using CO2 extraction. Carbon dioxide under extreme pressure will act as an effective agent to extract the active compounds in cannabis. This method uses no hydrocarbon based inputs, as such it is considered by many to produce the safest product with no chance of residual solvents. ", retailer_id: 2, images: ["https://s3.amazonaws.com/media.nimbusfly.co/bailey/Co2_CBD_Syringe_40%25_Single_DSC_3864.jpg"], prices: [70.0], price_labels: ["each"], thc: "0.0", cbd: "40.0", subspecies: "", category: "Cannabis Oil (Tears)", thumbnail: nil, stock: nil},
