  {name: "Purple Kush Budder", description: "Purple Kush budder is strong indica medicine providing almost immediate appetite stimulation and a deep relaxing stone. The flavor from the purple kush transitions perfectly to the concentrate, saturating your mouth with a deep fruity kush flavour. Useful for relief of minor aches and pains and as a sleep aide, this stuff is strong enough to put any racing mind to rest.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3851886_Purple_Kush_Budder.jpg"], prices: [62.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
