  {name: "Og Budder", description: "The OG Budder has a smooth amber honey like texture with an intense deep classic OG reek smell. No butane linger at all. This concentrate tastes just as it smells. Your nostrils will tingle from the sour and your lungs will quickly expand. The effects are almost instant with a head rush followed by a deep couch like body high. \r\nThis strain is recommended for anxiety, pain, sleep, cramps, and headaches.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3851995_OG_Budder.jpg"], prices: [62.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
