  {name: "Nuken", description: "The mostly indica Nuken is a Canadian strain bred by combining genetics from Kish (a cross of two Shishkaberry parents) and God Bud. Her even-keeled effects are delivered alongside a sweet, earthy aroma of fresh herbs and grass. While undeniably strong, Nuken typically leaves you functional enough to still enjoy hobbies and the company of friends. Nuken blooms with rounded, dense buds covered in a blanket of crystal resin veiling its sage hues.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3866197_nuken__primary_6748.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Blackberry Kush", description: "This mostly indica strain is a mix of Afghani and Blackberry strains and has beautiful dark purple buds with orange hairs. Plants will flower at 7-8 weeks and are not particularly high yielders, but the dense, hard nugs have crystals throughout. Blackberry Kush tends to have a hashy, jet fuel smell and taste that is balanced by sweet berries. Blackberry Kush is often recommended for the treatment of pain thanks to its strong indica body effects.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3866187_blackberry-kush__primary_71dd.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Lindsay Og", description: "The Lindsay, an OG Kush named after the town of Lindsay, Ontario, and originated from Chad Jacketts crew when they first arrived in BC ten years ago. Refined and improved over the years, The Lindsay was entered on behalf of the Cannabis in Canada Society where it placed 2nd among BCs finest strains. Refined and improved over the years, The Lindsay was entered in the karma cup of 2015 and won the best Indica in Canada. Very potent strain, smooth smoke and smell penetrates the toughest of containers. Great for nausea, appetite loss, insomnia, chronic pain. Heavy mental and physical effects.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3799453_Lindsay_OG.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Blue God", description: "Blue God, bred by Jordan of the Islands in Canada, is a powerful indica mothered by God Bud and Blueberry. Fulfilling all of our Indica expectations, Blue God produces crushing, full-body effects ideal for night-time treatment of pain and sleep disorders. With age, Blue God develops a sweet, berry aroma and deep purple leaves freckled in frosty resin. Cultivators of this stout Indica suggest growing Blue God as a multi-branch plant in soil, with a flowering period between 55 and 60 days.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3774141_Blue_God.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 140.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Island Pink", description: "In its exceptional variations, pink hairs burst from bright green buds barely visible under a blanket of sugar-like trichomes, with traces of a sweet vanilla and candy perfume. The potency of this strain could be considered overpowering, and even small doses are known to eliminate pain, insomnia, and appetite loss.", retailer_id: 11, images: ["https://images.weedmaps.com/pictures/listings/362/230/360/large/3835739_351783552.jpg"], prices: [13.0, 26.0, 45.0, 90.0, 180.0, 360.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
