  {name: "*New*(Aaa Grade)  Granddaddy Purple", description: "\r\nIntroduced in 2003 by Ken Estes, Granddaddy Purple (or GDP) is a famous indica cross between Purple Urkle and Big Bud. This California staple inherits a complex grape and berry aroma from its Purple Urkle parent, while Big Bud passes on its oversized, compact bud structure. GDP flowers bloom in shades of deep purple, a contrastive backdrop for its snow-like dusting of white crystal resin.\r\n\r\nIts potent psychoactive effects are clearly detectable in both mind and body, delivering a fusion of cerebral euphoria and physical relaxation. While your thoughts may float in a dreamy buzz, your body is more likely to find itself fixed in one spot for the duration of GDPs effects. Like most heavy indica varieties, Granddaddy Purple is typically pulled off the shelf to treat pain, stress, insomnia, appetite loss, and muscle spasms. GDP blesses growers with massive commercial yields which are ready for harvest following a 60 day flowering time indoors.", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840294_granddaddy_purple.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "*New* Kushberry", description: "Kushberry is the perfect blend of two West Coast flavors, Blueberry from Oregon and the OG Kush from LA. The exotic flavor doesnt rival its strength; it is one of DNA Genetics strongest strains. Kushberry is known for relieving pain, sleeplessness, and appetite loss.\r\n", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840150_kushberry.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
