  {name: "*New* Super Silver Haze", description: "Super Silver Haze, bred by Green House Seeds, was the first prize winner at the High Times Cannabis Cup in 1997, 1998, and 1999. It also won awards at the High Times Harvest Festival. By crossing the genetics of Skunk, Northern Lights, and Haze, we are left with a beautiful, sticky sativa blend that boasts an energetic, long-lasting body high. The uplifting effects are a great remedy for high stress levels or when suffering from a lack of appetite or nausea.", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840163_super_silver_haze.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "*New* Harlequin", description: "Harlequin is a 75/25 sativa-dominant strain renowned for its reliable expression of CBD. A descendant of Colombian Gold, a Nepali indica, and Thai and Swiss landrace strains, you can depend on Harlequin to provide clear-headed, alert sativa effects. Unlike most high-CBD strains, Harlequin almost always develops a CBD:THC ratio of 5:2, making this strain one of the most effective out there for treatment of pain and anxiety, as CBD can counteract THCs paranoia while amplifying its painkilling properties. Flavors can range from earthy musk to sweet mango, but without a doubt, what draws crowds to Harlequin is its ability to relax without sedation and to relieve without intoxication.", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840136_harlequin.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "*New* Black Widow", description: "\r\nOriginally created by legendary breeder Shantibaba when he was co-owner of Green House Seeds, Black Widow was then known as White Widow. When Shantibaba left GHS and found Mr. Nice Seeds, he took the original Brazilian sativa mother and South Indian indica-dominant hybrid father with him to recreate his world renowned White Widow seeds. Because GHS and others were selling seeds with the name White Widow, he changed the name to Black Widow to create a distinction between them. Black Widow is now considered by many to be the only true White Widow available in seed form, as Mr. Nice is the lone seed breeder to possess the original parental genetics.", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840155_black_wedow.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "*New* Sweet Tooth", description: "Sweet Tooth was awarded 1st place at the High Times Cannabis Cup in 2001, and as you could probably guess from the name, it has a sweet smell of flowers and berries that accompanies it. The potent colas of this balanced hybrid are candy-coated with trichomes, providing uplifted and euphoric effects that are great for combating stress and headaches. Bred by Barneys Farm, Sweet Tooths genetics sprout from mixing landrace strains from Afghanistan, Hawaii, and Nepal.\r\n", retailer_id: 14, images: ["https://images.weedmaps.com/pictures/listings/287/758/071/large/3840139_sweet_tooth.jpg"], prices: [12.0, 40.0, 75.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
