  {name: "Og Four 2.0 Vaporizer", description: "The OG Four 2.0 Pen-Style Vape is a fresh new design from This Thing Rips! featuring a stylish chrome finish and an orange polycarbonate heating chamber.  The OG Four 2.0 uses a quartz rod single coil atomizer that is well-received for vaporizing concentrates cleanly and purely, leaving no additional taste behind.  These coils are designed to heat to the lowest possible temperature for vaporization, giving you all of the freshness associated with low-temperature concentrate smoking.  The OG Four 2.0 also comes packaged with an additional quartz atomizer, a 6500mAh battery, a dabber tool, a silicone concentrate jar, 2 cleaning wipes, and a usb connector that allows for easy charging from anywhere.  The OG Four 2.0 is the next big thing for vape fans and concentrate connoisseurs alike, and with its flashy orange style you'll be making clouds and taking names!", retailer_id: 16, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [105.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
