  {name: "Blue Dream", description: "\"\r\nBlue Dream, a sativa-dominant hybrid originating in California, has achieved legendary status among West Coast strains. Crossing a Blueberry indica with the sativa Haze, Blue Dream balances full-body relaxation with gentle cerebral invigoration. Novice and veteran consumers alike enjoy the level effects of Blue Dream, which ease you gently into a calm euphoria. Some Blue Dream phenotypes express a more indica-like look and feel, but the sativa-leaning variety remains most prevalent.\r\n\r\nWith a sweet berry aroma redolent of its Blueberry parent, Blue Dream delivers swift symptom relief without heavy sedative effects. This makes Blue Dream a popular daytime medicine for patients treating pain, depression, nausea, and other ailments requiring a high THC strain. \"\r\n-from Leafly.com", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3866215_blue_dream.jpg"], prices: [13.0, 26.0, 42.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Atomic Blue Cookies", description: "A cross betwee Atomical Haze and Blue Cookies (Blueberry Kush and Girl Scout Cookies) This strain is very potent, typically recommended for thc-veterans. ", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3866200_blue_cookies.jpg"], prices: [13.0, 26.0, 42.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Duke Nukem", description: "\"Duke Nukem may be named after a video game character who spends his days obliterating alien bastards, but this strain is a lot more laidback than its action hero namesake. The mostly sativa hybrid produces an active mental high that is uplifting and may have you feeling more creative than commando. Its a cross between Chemmando and Chernobyl and flowers in 9 to 11 weeks. The strain is a fairly easy plant to grow and should give medium to high yields. Its buds are known to be especially colorful with shades of frosty pinks and oranges. Careful not to confuse this strain with Nuken, which is a different indica dominant hybrid.\"\r\n-From Leafly", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3866171_duke_nukem.jpg"], prices: [13.0, 26.0, 42.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Pineapple Trainwreck", description: "Bring together the popular clear-headed effects of Pineapple Express and the pain relief qualities of Trainwreck and you get this happy sativa. Pineapple Trainwreck has an earthy aroma and a fruity flavor that usually takes more after its pineapple parent. Long-lasting and potent, this strain hits hard at first, but mellows into a state where being sociable or getting things done is possible. The buzz tends to be more mellow than active, though, so dont be surprised if verbal activity is all you get around to.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3847876_Pineapple_Trainwreck.png"], prices: [13.0, 26.0, 42.0, 80.0, 150.0, 280.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Thin Mints", description: "Thin Mint, a hybrid cross between Durban Poison and OG Kush, is a phenotype of the legendary Girl Scout Cookies strain. Dark green and royal purple leaves peek through a heavy coat of crystals, with a sweet minty smell that gives a full explanation of this strains name. Thin Mint calls upon the powers of its indica, sativa, and hybrid ancestors for a powerful full-body effect that gives this strain its sterling reputation. The high psychoactivity of this strain is not for novice consumers, but patients with a variety of symptoms are giving Thin Mint their seal of approval: severe pain, nausea, swelling, insomnia, and appetite loss are no match for the potency of Thin Mint.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3724958_thin-mint-girl-scout-cookies.jpg"], prices: [12.0, 24.0, 40.0, 76.0, 144.0, 275.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Coconut Thc Capsules (50mg)", description: "Ingredients:\r\nTHC Extract Infused Coconut Oil, Lecithin, Vegetable Cellulose Capsule.\r\n\r\n** Administer as needed every 4-6 hours. Keep out of reach of children and pets.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3866603_thc_caps.jpg"], prices: [7.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Phoenix Tears 400mg [Vintage Oils &Amp; Extracts}", description: "", retailer_id: 19, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [35.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Edibles", thumbnail: nil, stock: nil},
  {name: "Hindu Kush", description: "Hindu Kush is a pure indica strain named after the mountain range stretching 500 miles between Pakistan and Afghanistan where it originated. The harsh climate of its homeland has conditioned this strain to express a thick, protective coat of crystal trichomes cherished by hash makers worldwide. With a subtle sweet and earthy sandalwood aroma, Hindu Kush induces a deep sense of calm that helps bring relief to those suffering pain, nausea, and stress disorders.", retailer_id: 18, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [12.0, 40.0, 80.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Moon Rocks", description: "Pink Kush slathered in shatter and rolled in keif.", retailer_id: 18, images: ["https://images.weedmaps.com/pictures/listings/849/850/608/large/3669939_PK_MOONROCKS.jpg"], prices: [35.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Nuken God", description: "While undeniably strong, Nuken typically leaves you functional enough to still enjoy hobbies and the company of friends", retailer_id: 18, images: ["https://images.weedmaps.com/pictures/listings/849/850/608/large/3536919_nuken_god.jpg"], prices: [12.0, 24.0, 40.0, 80.0, 150.0, 300.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Pink Kush", description: "Indica Dominant Hybrid with powerful body-focused effects. Even for veteran consumers, the heaviness of this strain could be considered overpowering, and even small doses eliminate pain, insomnia, and appetite loss. ", retailer_id: 18, images: ["https://images.weedmaps.com/pictures/listings/849/850/608/large/3348102_IMG_0110__1_.jpg"], prices: [10.0, 20.0, 35.0, 65.0, 125.0, 250.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Sour Diesel", description: "An invigorating sativa named after its pungent, diesel-like aroma. This fast-acting strain delivers energizing, dreamy cerebral effects that have pushed Sour Diesel to its legendary status. Stress, pain, and depression fade away in long-lasting relief that makes Sour Diesel a top choice among medical patients. ", retailer_id: 18, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [14.0, 45.0, 90.0, 180.0, 340.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Strawberry Cough", description: "Known for its sweet smell of fresh strawberries and an expanding sensation that can make even the most seasoned consumer cough, Strawberry Cough is a potent sativa blend with mysterious genetic origins. The skunky, berry flavors will capture your senses while the cerebral, uplifting effects provide an aura of euphoria that is sure to leave a smile on your face. Strawberry Cough is a great solution for managing social anxieties and to balance yourself in times of elevated stress.", retailer_id: 18, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [12.0, 40.0, 80.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Cherry Og", description: "A hybrid cannabis strain bred by combining Cherry Thai, Afghani, and Lost Coast OG genetics. A 50/50 hybrid, Cherry OG truly brings you the best of both sativa and indica worlds as it delivers full-body euphoria alongside high-flying cerebral lucidity. While its name sets expectations of a fruity cherry aroma, this strain can sometimes express more sour and diesel-like flavors. ", retailer_id: 18, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [12.0, 40.0, 80.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "White Widow", description: "White Widow, a balanced hybrid first bred in the Netherlands by Green House Seeds. A cross between a Brazilian sativa landrace and a resin-heavy South Indian indica. Its buds are white with crystal resin, warning you of the potent effects to come. A powerful burst of euphoria and energy breaks through immediately, stimulating both conversation and creativity.", retailer_id: 18, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [12.0, 40.0, 80.0, 150.0, 300.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
