  {name: "Juju Joint", description: "JUJU Joints are the most discreet vaporizers on the planet. Loaded, charged and ready to enjoy, they are designed specifically for oil and produce low odor \r\nExplore the range of experiences through potent, clean, and unique THC combinations \r\nSmallest vaporizer on the market, fits in the palm of your hand \r\n\r\nFits discreetly in your hand, \r\nsimple to use\r\nStrain specific CO2 \r\nconcentrated THC oil \r\nExtracted from 4 grams of\r\nflower in every 250mg of oil\r\nExperience cannabis \r\nwithout any of the hassle \r\nNo PG/PEG or additives ", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3724992_admin-ajax.jpeg"], prices: [], price_labels: [], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
