  {name: "Genie Grinder", description: "Available in variety of different sizes. Prices range from $20.00 - $30.00.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3727089_41WrgwWl26L._SY355_.jpg"], prices: [20.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "G Pen Slim", description: "Introducing the G Slim Series, a new line of lightweight technology that combines the luxury of portability with the benefit of affordability.\r\n\r\nSleek in form, with simplicity in operation, the G Slim Vaporizer provides high-performance functionality in a compact apparatus.\r\n\r\nEach G Slim comes equipped with a G Slim Tool, Wireless USB Charger, and an On/Off feature to safeguard against inadvertent activation.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3727082_GSlim-Web_grande.jpg"], prices: [20.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "G Pen", description: "The G Pen Vaporizer is a revolutionary G Pen inspired by the spirit of the microG. A complete set, the G Pen Vaporizer includes all components required for immediate startup. Sleek in form and specific in purpose, the G Pen Vaporizer is intended for use with thicker viscosity fluids and is a must-try for all Original microG enthusiasts.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3727065_g-pen.jpg"], prices: [75.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "G Pro Herbal Vaporizer", description: "Grenco Science proudly unveils the G Pro Vaporizer, a technological marvel offering convection vaporization in truest form.\r\nFounded on the principles of performance and user-preference, the G Pro Herbal Vaporizer features three variable temperature settings, enabling a uniquely-fitted vaping experience.\r\n\r\nDurable in design and sophisticated in aesthetic, the G Pro's internal structure is comprised of a heavy duty, stainless steel heating chamber that releases the active ingredients in botanicals without the harmful byproducts caused by traditional methods.\r\n\r\nThe first release in the advanced G Pro Series, the G Pro Vaporizer produces pure vapor for optimum flavor, establishing a new standard of excellence across the vaporizer industry.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3335071_gproherb.jpg"], prices: [95.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "Space Case Large Grinder", description: "Often imitated, but never duplicated, Space Case Grinders are an investment that are built to last a lifetime. Featuring grinding teeth that never dull, a screen that doesn't clog, and a neodymium magnet that holds your grinder together, the Space Case Grinder sets itself apart from the competition. Measuring in at 3 1/2\" in diameter and 2 1/2\" in height, the Large 4 pc. Space Case grinder-sifter is great for grinding a lot of herbs at once. Manufactured in the USA, Space Case grinders are made to the highest specifications out a single piece of aircraft grade aluminum. Using CNC machining, Space Case grinders feature razor sharp grinding teeth and a grinding movement that is smooth as glass grinding through the toughest herbs with ease. The Titanium Space Case Grinders feature an anodized titanium coating, which strengthens the unit up to 100%. The titanium finish also increases the unit's non-stick properties so that your herbal blend doesn't get stuck in the grinding teeth and requires less cleaning than traditional grinders. A smoker's favorite for years, the Space Case Grinder-Sifter grinds your herbal blend to the perfect consistency for vaporization and separate the pollens with the sifter chamber. Included is a triangle scraper to collect your pollen, which is specially designed to scrape the edges perfectly.", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3726969_614xovAw3SL._SL1146_.jpg"], prices: [150.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "Dr. Dabber Boost E Rig", description: "The Dr. Dabber Boost is the first portable, battery-powered dab rig, employing a titanium domeless nail much like you would see in traditional glass dab rigs. No torch required. The device heats to an optimal temperature with a simple button press, making it one of the easiest dabbing solutions available. Click the power button 3 times when using the titanium nail/ceramic nail, or click 5 times to unlock a higher heat setting for use with the quartz nail (included). When attached to the included glass water filtration piece, the Boost replicates the dabbing experience perfectly. Capable of 30 to 40 uses on a single battery charge, the Boost eRig truly is the best of both worlds: a portable dabbing experience without any sacrifice. *This unit is not suitable for dry herbs, only oils and waxes* ", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3248414_dr.dabber_boost.jpg"], prices: [270.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "Pax 2", description: "The Pax 2 portable vaporizer is smaller, lighter, more durable and easily one of the most reliable vaporizers that you can currently buy. The Pax 2 comes with better battery life, a deeper oven for more even heating and four different heat settings now instead of three on the original. The new temp range is also a wider spectrum. 10 degrees lower and 10 degrees higher for a bit more control during your sessions.\r\n", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3248465_pax-2-vaporizer-all-colors-side-by-side-vaporplants.jpg"], prices: [360.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
