  {name: "Dr. Dabber Aurora Concentrate Vaporizer", description: "The award-winning Dr. Dabber Aurora is a variable voltage, magnetic vaporizer pen designed with the user in mind. The best vape pen and only vaporizer with fully magnetic connections that make for a seamless user experience. Three carefully calibrated heat settings allows you freedom to experiment, and a sleek, discreet satin finish keeps things low key. The Aurora is the next generation of vaporizer pen, pairing innovative features with Dr. Dabber's signature award-winning 'low heat' technology seen across the entire line of vape pens. ", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3248420_vaporizer-aurora-vaporizer-pen-kit-1_1024x1024.jpg"], prices: [140.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Gear", thumbnail: nil, stock: nil},
  {name: "Cannalife Massage Oils", description: "Coming in various preparations; Invigorating, Sensual, Neutral (Unscented), Balancing and Soothing. There is a massage oil for any situation.\r\n\r\n", retailer_id: 19, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [20.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Topicals", thumbnail: nil, stock: nil},
  {name: "Cannalife Bath Soak And Scrub (6oz)", description: "100% Natural Medicated Bath Salt Crystals\r\n\r\nIngredients: Epsom Salts, Dead Sea Salts, Himalayan Pink Salts, Baking Soda, Cannabis infused grapeseed oil, Jojoba oil and a blend of essentials oils for each kind.\r\n\r\nDirections: Add 1/4+ cup of salt blend to your bath or use as a scrub. Soak for 20mins or more while the beneficial cannabinoids, vitamins and minerals absorb through the skin and toxins are pulled out. Use for pain relief, detox and cell rejuvenation.\r\n\r\nThree Kinds Available:\r\nElevate - Eucalyptus, Geranium, Bergamot\r\nCalm - Cedarwood Vanilla\r\nRelieve - Rosemary, Peppermint, Lavender", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3248402_download.jpg"], prices: [12.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Topicals", thumbnail: nil, stock: nil},
  {name: "Canna Life Arthritis Balm 60ml", description: "Our arthritis balm is deep penetrating and heat activating providing immediate relief to pain and inflammation. Combines the potent synergy of cannabis sativa, comfrey and nettle plant medicine.\r\n\r\n*All ingredients are top quality and organic when available.\r\n\r\nLab Tested (THC per unit):\r\n60ml: 166mg", retailer_id: 19, images: ["https://images.weedmaps.com/pictures/listings/880/608/475/large/3726798_IMG_7421.jpg"], prices: [40.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Topicals", thumbnail: nil, stock: nil},
