  {name: "Juicy Fruit Thc Distillate", description: "THC distillate is a pure product distilled at the molecular level. All waxes, terpenes, contaminants, and non-medicinal ingredients are separated and removed using a fractional distillation process.\r\n \r\n Note: Each syringe contains 1 gram and is measured by weight (grams) not volume (ml).", retailer_id: 20, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [100.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Honey Oil By Happy Valley Essentials", description: "Smoking oils are non-decarboxylated cannabis extracts. Honey/Cherry Oil are made using Isopropyl Alcohol, a food grade, non-toxic solvent that is purified before extraction and removed completely during production. Smoking oils are most effective where immediate absorption is needed. Cherry Oil is charcoal filtered to remove most chlorophyll. Honey Oil is filtered and winterized to remove both chlorophyll and waxes in addition to other plant material. Smoking oils can be smoked in a pipe, vaporized, rolled in a joint, or hot knifed. Use of cannabinoid medicines should always be used under the advice of a physician.\r\n \r\n * There will be variances in color and consistency (as are waxes and other plant material pulled out) from batch to batch.\r\n \r\n Note: Each syringe contains 1 gram and is measured by weight (grams) not volume (ml).", retailer_id: 20, images: ["/assets/attachments_missing/pictures/large_missing.jpg"], prices: [60.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
