  {name: "Blue God", description: "Product Description\r\nInterest/uniqueness/linage: Its parents Blueberry &amp; God Bud both took home Cannabis Cups and this child does not disappoint. These medium sized dense buds are tight which is a reflection of the squat plant that usually only grows 4 feet tall.\r\nBest use: The high is a body stone so best used in the evening when chilling at home.\r\nTaste: Blueberry, Berries, sweet.\r\nStrength: Medium-High Strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3838677_blueberry-god-for-sale-in-canada.jpg"], prices: [10.0, 20.0, 35.0, 70.0, 125.0, 210.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Ice Wreck", description: "Product Description:\r\nThis crop has turned into standard Westcoast smoke. Created by Crop Kings this is a nice balance of Sativa and Indica. It is a relatively high THC count but has the Sativa there to even things out.\r\nBest use:\r\nThis is good for a weekday evening chilling with a couple friends or in full party mode. You can roll them up phat and not get floored and stay social.\r\nTaste:\r\nFully, smoky but with a dash of mint.\r\nStrength:\r\nHigh-Medium strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3837160_ice-wreck-for-sale-in-canada-510x667.jpg"], prices: [10.0, 30.0, 55.0, 100.0, 185.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Ultimate Purple", description: "Product Description:\r\nUltimate Purple is just that purple. A cross of 4 types of purple strains give it name. This crop is not going to win any awards however it is a solid choice for those with a light wallet looking for a solid smoke this is a good choice. This is a heavy Indica that smokes well. Not going to overwhelm but also a good choice for novice or medium puffers. Also good choice for those needing some help sleeping.\r\nBest use:\r\nThis is a nice bud to roll up a fatty to and chill in the evening.\r\nTaste:\r\nBerries yet earthy.\r\nStrength:\r\nHigh strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3837076_ultimate-purple-bud-for-sale-510x667.jpg"], prices: [10.0, 30.0, 60.0, 100.0, 180.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Bubba Kush", description: "This sweet bud is covered with little frosted hairs that give its distinctive look and taste. Our Bubba Kush crop has been grown to perfection. We use this same strain to make our premium shatter. If you like the Kush, you definitely have to try some of this Bubba Kush. \r\n\r\nBest use: Bubba Kush has a high THC level and considered one of the stronger indica hybrids, which make it great for veging out and popping on the tunes or watching a flick.\r\n\r\nTaste: Vanilla Cake\r\n\r\nStrength: High strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499855_Bubba-Kush-Stash-Club.jpg"], prices: [11.0, 35.0, 60.0, 110.0, 200.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Tuna Kush", description: "Named after the infamous smugglers of marijuana in the 70s. This organic British Columbian strain is top notch. This is a rare crop. Buds are compact, crystal laden and strong smelling. \r\n\r\nBest use: Very Strong but clean high. Great to stay clear headed yet chill. Not recommended for novice smokers.\r\n\r\nTaste: Earthy, pungent, hint of diesel.\r\n\r\nStrength: High strength\r\n \r\n*Buy Tuna Kush online from the Stash Club.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499858_tuna-kush-stash-club.jpg"], prices: [12.0, 35.0, 70.0, 130.0, 230.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Master Kush", description: "The Master Kush strain was created in Amsterdam when it was crossed with two plants from the Hindu Kush Mountains. Probably the most grown Kush around, Master Kush is a great Indica for good reason. The well-balanced effects of the Indica provide strong pain relief and body relaxation while not leaving you overly tired or hungry. \r\nBest use: Typically these larger volumous buds give nice body relaxation without too much mind numbing effects that indicas are known for. People tend to love the taste of Master Kush.\r\nTaste: Sweet &amp; fruity yet earthy.\r\nStrength: High strength\r\n*Buy Master Kush online at the Stash Clubs online dispensary.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499861_Master-Kush-Stash-Club.jpg"], prices: [11.0, 30.0, 60.0, 110.0, 200.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Lindsay Og", description: "Lindsay OG was the winner of the Karma Cup, this premium award winning strain is the darling of all the tastemakers right now. This Lindsay OG, a strong Indica, has rock hard dense buds and packs a serious punch. If your looking for deep relaxation or pain relief, than this is a great option.\r\nBest use: Excellent clean high that will not disappoint the pickiest smokers. Best pared with reggae.\r\nTaste: Smooth sweet taste\r\nStrength: High strength\r\n\r\n*Buy Lindsay OG online at our curated online dispensary.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499859_Lindsay-OG-Stash-Club.jpg"], prices: [10.0, 30.0, 60.0, 110.0, 195.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Indica", thumbnail: nil, stock: nil},
  {name: "Blonde Bubble Hash", description: "Unprocessed, light and flakey, this hash is made from ice water extraction using 120 u and 160 u filters and was gently pressed. It's made from a mix of Indica strains mostly Kush's.\r\n\r\nBest use: Light heady high that is talkative and good at getting things done.\r\n\r\nTaste: Light smooth taste.\r\n\r\nStrength: Medium intensity high.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3582743_blonde-bubble-hash.jpg"], prices: [20.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Cali Orange Tangerine", description: "Interest/uniqueness/linage\r\nThese big fluffy buds have some of the lightest and sweet taste you find.  The Cali Orange can be a nice daytime work buddy if in moderation. Gives a big euphoric high but is defined by it's sweet taste with no chance of couch-lock.\r\n\r\nBest use\r\nDue to the 50% Sativa - 50% Indica cross this is a versatile bud that can be broken out in all occasions. Best employed in small doses if you want to stay productive. \r\n\r\nTaste\r\nSweet. Orange, Citrus.\r\n\r\nStrength\r\nHigh Strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3827546_cali-orange-for-sale-in-canada.jpg"], prices: [12.0, 24.0, 35.0, 65.0, 120.0, 210.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Space Queen", description: "Product Description:\r\nThis glorious bud is famed and rare. Signature flaming red hairs of juicy goodness.\r\nBest use:\r\nThis is very strong not for novice or light smokers. Space Queen delivers an intense galactic experience.\r\nTaste:\r\nApples, vanilla and cherries.\r\nStrength:\r\nHigh Strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3837048_space-queen-for-sale-weed-maps.jpg"], prices: [12.0, 35.0, 70.0, 125.0, 220.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Sativa", thumbnail: nil, stock: nil},
  {name: "Pennywise", description: "(Interest/uniqueness/linage) This strain has a 1:1 ratio of THC and CBD, which ranges between 12 and 15%. So, for every 1 percent of THC (the psychoactive chemical in Cannabis), there is also 1 percent of CBD (the non-psychoactive compound with far more healing capabilities). (Taste) Light and fluffy. (Strength) High-Medium\r\n\r\nPennywise is medically used to combat anxiety and depression; however, many athletes also use it. Also an excellent herb for the writers and professionals keeping it fit. Pennywise is a nice advanced puffers choice. \r\n\r\n*Review the strain and win goodies and extras.\r\n\r\nBuy Pennywise strain at the curated online dispensary. Stash Club.  \r\n", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3824428_pennywise-bud-for-sale.jpg"], prices: [12.0, 24.0, 35.0, 70.0, 125.0, 220.0], price_labels: ["Gram", "Two Grams", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "God's Green Crack", description: "Rich in colour and crystals. Like all great Hybrids its beauty is in its balance. Mother and father have passed on only the best genes to this crop. The God Bud strain mixed with Green Crack creates a delicious combination with lighter coloured buds and a sweet, floral, fruity nose. Enjoy the euphoric effects of the sativa influences, but stay relaxed and grounded by the Indica genes. This is a great combination that heavy Indica uses will enjoy for  day time use, or for the Sativa fan who is looking for some elevated relaxation.\r\nBest use: Great choice for a camping weekend at the lake or afternoon on the beach.\r\nTaste: Hints of vanilla and chocolate ice cream\r\nStrength: Medium Strength", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499860_God_s-Green-Crack-Stash-Club.jpg"], prices: [10.0, 30.0, 60.0, 110.0, 190.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Blackberry Hashplant", description: "Blackberry Hashplant is a wonderful combination of full tasting smoke with a skunky smell that ends with a sweet berry taste. A smokers delight this will not disappoint with optics, taste or effect. Unlike lots of hashplant strains that knock you out, this crop keeps your mind elevated, while providing deep body relaxation or pain relief. \r\n\r\nBest use: Day or night, these versatile buds that can be brought out in any situation.\r\n\r\nTaste: Nutty, earthy &amp; sweet blackberry taste.\r\n\r\nStrength: High strength\r\n\r\nBuy Blackberry Hashplant at the Stash Clubs online dispensary.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3499863_Blackberry-Hashplant-stash-club.jpg"], prices: [10.0, 30.0, 60.0, 110.0, 195.0], price_labels: ["Gram", "Eighth", "Quarter", "Half Ounce", "Ounce"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Hybrid", thumbnail: nil, stock: nil},
  {name: "Liquid Gold Caps", description: "Organic. Lab-tested. Non-GMO, All Natural, Gluten Free.\r\nLiquid Gold Caps are safe and discreet way of ingesting cannabis. Top quality extracts are hand selected to acquire a broader Cannabinoid profile to maximize medical benefits. They are expertly infused with organic coconut oil and encapsulated in non-GMO organic caps. Excellent in treating chronic pain, anxiety, depression, menstrual cramps, nausea, and many other medical conditions. Immune system booster when taken daily. Made with love in Vancouver Canada.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3838613_cbd-capsules-510x667.jpg"], prices: [30.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Edibles", thumbnail: nil, stock: nil},
