  {name: "Qush Shatter   Sativa", description: "This is our current Sativa Shatter option. This is high grade. Tested out very well with our group of connoisseurs. To keep it clean the producer purged it for 3 days. That's right 3 days. This is a tricky task to keep such good consistency.\r\n\r\nBest use: Use a Bubbler or pop a dab in your vape. It doesn't matter. This stuff will hit.\r\n\r\nTaste: Full yet smooth taste.\r\n\r\nStrength: High strength.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3582596_shatter-blond-butter-400x400.jpg"], prices: [65.0], price_labels: ["Gram"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Concentrates", thumbnail: nil, stock: nil},
  {name: "Gold Thc Mist   Apothecary (Indica)", description: "Sublingual and fast acting\r\n60 sprays per bottle\r\nFast-acting alternative for discrete use (looks like breath freshener) and tastes great\r\nConvenient pocket / purse size\r\nEffective relief from all forms of general inflammatory and neuropathic pain.\r\nOur mists offer significant advantages over other methods of administering medical cannabinoids: a micro-atomizer sprays a precise dose into the mouth. Absorption via oral mucosa into the bloodstream is fast and dependable. The oral spray is not processed by the digestive system and liver into a metabolite as occurs with orally ingested cannabinoids in edibles. This means the effect is similar to smoking cannabis but without the smoke.\r\nPatients report that the precision-dose atomizer makes it easy to achieve the appropriate level of medication. Unlike edibles, you know within a few minutes if the initial dosage was sufficient. Start with 12 sprays, increasing by 1 spray at a time, if necessary.\r\nUnlike edibles, our Mist is absorbed via oral mucosa directly into the bloodstream. Effect is similar to smoking cannabis but without the smoke. Onset within 15 minutes; lasts 1-2 hours.", retailer_id: 5, images: ["https://images.weedmaps.com/pictures/listings/957/953/548/large/3838534_mists-apothacary.png"], prices: [16.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Tinctures", thumbnail: nil, stock: nil},
