  {name: "Crop King Seeds", description: "If you are a medical patient, a closet grower or an experienced grow master, we have the best strains for sale for large yields, high levels of THC and various varieties of Indica, Sativa and Hybrid cannabis plants. Crop King seeds has same day shipping available for Canada and all countries in the world that come with a catalog and our state of the art pot seed packaging.crop king seeds offers a 24 hour a day customer service line for any seeds that don't grow.\r\n  \r\nChoosing the Right Type of Marijuana Seeds for You\r\n\r\nBefore you purchase pot seeds you should know that price is not always the most important thing. Cheap marijuana seeds are cheap for a reason because they might have a poor germination rate or might not be viable for germinating. Most of our customers choose strains that have large yields and high THC content with a High or Low CBD (cannabidiol) rating as well as CBN (cannabinol) levels.\r\n  \r\nFeminized or Autoflowering Marijuana Seeds For Sale\r\n\r\nWe have a large selection of indoor or outdoor marijuana seeds for sale from Cannabis Cup winners such as White Widow and Northern Lights. Feminized marijuana seeds will produce only female plants from which produce the flower or the bud which is the smokeable part which contains THC. Autoflowering marijuana seeds are fast flowering strains that will flower automatically during any light cycle", retailer_id: 3, images: ["https://images.weedmaps.com/pictures/listings/283/515/853/large/3278105_crop_king.jpg"], prices: [60.0], price_labels: ["Unit"], thc: "0.0", cbd: "0.0", subspecies: nil, category: "Seeds", thumbnail: nil, stock: nil},
